import React from 'react'

const Naviagation = () => {
  return (
    <nav className='flex items-center py6 px-16 justify-between'>
        <div className='flex items-center gap-6'>
            <h2 className='text-3xl text-black' >DripG</h2>
        </div>
    </nav>
  )
}

export default Naviagation
